import React from 'react';
import { Routes, Link, Route } from 'react-router-dom';
import "./Sidemenu.css";
import ProfileImage from "./profile_image.jpeg";
import { About } from '../../pagecontent';

function Sidemenu(){
    return(
        <Routes>
            <section>
                <nav className="navbar navbar-expand-lg navbar-dark bg-primary fixed-top" id="sideNav">
                    <a className="navbar-brand js-scroll-trigger" href="#page-top">
                        <span className="d-block d-lg-none">Rochelle Gracias</span>
                        <span className="d-none d-lg-block"><img className="img-fluid img-profile rounded-circle mx-auto mb-2" src={ProfileImage} alt="..." /></span>
                    </a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation"><span className="navbar-toggler-icon"></span></button>
                    <div className="collapse navbar-collapse" id="navbarResponsive">
                        <ul className="navbar-nav">
                            <Link className="nav-link js-scroll-trigger" to="/about"><li className="nav-item">About</li></Link>
                            <li className="nav-item"><a className="nav-link js-scroll-trigger" href="#experience">Experience</a></li>
                            <li className="nav-item"><a className="nav-link js-scroll-trigger" href="#education">Education</a></li>
                            <li className="nav-item"><a className="nav-link js-scroll-trigger" href="#skills">Skills</a></li>
                            <li className="nav-item"><a className="nav-link js-scroll-trigger" href="#certificates">Certificates</a></li>
                            <li className="nav-item"><a className="nav-link js-scroll-trigger" href="#projects">Projects</a></li>
                            <li className="nav-item"><a className="nav-link js-scroll-trigger" href="#interests">Interests</a></li>
                        </ul>
                    </div>
                </nav>
            </section>
            <Route path="/a" element={<About />} /> 
        </Routes>
    )
}

export default Sidemenu;
